import React from 'react';

const Browse = () => {
  const containerStyle = {
    textAlign: 'center',
    
  };

  const headingStyle = {
    fontSize: '24px',
    fontWeight: 'bold',
    marginBottom: '20px',
  };
  const imageStyle = {
    width: '250px', // Increase the width of the image
    height: '250px', // Increase the height of the image
    objectFit: 'cover', // Maintain aspect ratio
    borderRadius: '10px', // Optional: Add border-radius for rounded corners
  };

  const productContainerStyle = {
    display: 'flex',
    justifyContent: 'center',
  };
  
  const productStyle = {
    margin: '0 10px', // Adjust the margin as needed
  };

  const imageStyles = {
    width: '400px', // Adjust the width as needed
    height: '400px', // Adjust the height as needed
    objectFit: 'cover', // Maintain aspect ratio
    borderRadius: '10px', // Optional: Add border-radius for rounded corners
  };

  const priceStyle = {
    marginTop: '10px',
    fontSize: '18px',
    fontWeight: 'bold',
    color: 'green', // Optional: Set the color for the price
  };
  const paradesign = { padding :'50px',
  };

  return (
    <div style={containerStyle}>
        <div style={paradesign}>
      <h1 style={headingStyle} >Browse The Range
      </h1>
      </div>
      <p style={paradesign}>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptate porro,<br/> maxime perspiciatis adipisci laboriosam mollitia id, architecto in placeat distinctio consequatur ad quas ea vero beatae, dolor at asperiores magnam.
      </p>

      <div style={productContainerStyle}>
        <div style={productStyle}>
          <img
            src="/Mask Group_page-0001.jpg"
            alt="Tree 1"
            style={imageStyles}
          />
          <p style={priceStyle}>$50.00</p>
        </div>

        <div style={productStyle}>
          <img
            src="/living.jpg"
            alt="Tree 2"
            style={imageStyles}
          />
          <p style={priceStyle}>$65.00</p>
        </div>
        <div style={productStyle}>
          <img
            src="/mark.jpg" // 
            alt="Tree 2"
            style={imageStyles}
          />
          <p style={priceStyle}>$65.00</p>
        </div>
        
      </div>
    </div>
  );
};

export default Browse;
